--
-- Struttura della tabella `tab_segnalazioni`
--

CREATE TABLE IF NOT EXISTS `tab_segnalazioni` (
  `id_segnalazione` int(11) NOT NULL AUTO_INCREMENT,
  `id_tipo` int(11) NOT NULL,
  `id_competenza` int(11) NOT NULL DEFAULT '0',
  `id_ente` int(11) NOT NULL DEFAULT '0',
  `lng` double NOT NULL,
  `lat` double NOT NULL,
  `id_comune` int(11) NOT NULL DEFAULT '0',
  `stringa_indirizzo` text COLLATE utf8_unicode_ci NOT NULL,
  `civico` text COLLATE utf8_unicode_ci NOT NULL,
  `indirizzo` text COLLATE utf8_unicode_ci NOT NULL,
  `indirizzo_url` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `citta` text COLLATE utf8_unicode_ci NOT NULL,
  `citta_url` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `provincia` text COLLATE utf8_unicode_ci NOT NULL,
  `regione` text COLLATE utf8_unicode_ci NOT NULL,
  `regione_url` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `nazione` text COLLATE utf8_unicode_ci NOT NULL,
  `codice_nazione` varchar(2) COLLATE utf8_unicode_ci NOT NULL,
  `cap` text COLLATE utf8_unicode_ci NOT NULL,
  `id_utente` int(11) NOT NULL,
  `messaggio` text COLLATE utf8_unicode_ci NOT NULL,
  `stato` int(11) NOT NULL DEFAULT '100' COMMENT '0 -> ricevuta; 1-99 -> rifiutata; 100 -> Maiora ok; 200 -> In carico; 300 -> risolta',
  `confermata` tinyint(1) NOT NULL DEFAULT '0',
  `risolta` tinyint(1) NOT NULL DEFAULT '0',
  `eliminata` tinyint(1) NOT NULL DEFAULT '0',
  `archiviata` tinyint(1) NOT NULL DEFAULT '0',
  `data` int(11) NOT NULL,
  `client` text COLLATE utf8_unicode_ci NOT NULL,
  `versione` text COLLATE utf8_unicode_ci NOT NULL,
  `ip` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `__upd` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id_segnalazione`),
  KEY `index_id_comune` (`id_comune`),
  KEY `index_id_utente` (`id_utente`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

